import * as React from 'react'
import Box from '@mui/material/Box';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import Calendar from './Calendar';
import Paper from '@mui/material/Paper';
function Schedule() {
    const [viewtype, setviewtype] = React.useState('Calendar');
    //width: '100vw', height: '100vh'
    return(
        <Box className='schedule'sx={{position: 'relative', top: '60px'}}>
            <paper variant="outlined" >
                <Stack spacing={0} direction="row" sx={{display: 'flex', justifyContent:'center',
                alignItems:'center',margin: 'auto', width: '70vw'}} varian="outlined">
                    <Button onClick={() => {
                    setviewtype('List');
                    }}>List</Button>
                    <Button onClick={() => {
                    setviewtype('Calendar');
                    }}>Calendar</Button>
                </Stack>
            </paper>
            {viewtype === 'Calendar' ? (
            <Calendar/>
          ) : viewtype === 'List' ? (
            <div>HOLY SHIT I JUST HIT A CLIP</div>
          ) : null}
        </Box>
    );
}

export default Schedule;
